-- 테이블 withxwork.alarms 구조 내보내기
CREATE TABLE IF NOT EXISTS `alarms` (
  `alarm_no` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '알림 번호',
  `emp_id` int(11) unsigned NOT NULL COMMENT '수신 사원 번호',
  `alarm_title` varchar(255) NOT NULL COMMENT '알림 제목',
  `alarm_context` varchar(255) NOT NULL COMMENT '알림 내용',
  `alarm_type` varchar(50) NOT NULL COMMENT '알림 유형',
  `alarm_reference_no` int(11) unsigned NOT NULL COMMENT '알림 참조 번호',
  `alarm_create_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT '알림 발생 시간',
  `alarm_read_time` datetime DEFAULT NULL COMMENT '알림 확인 시간',
  `alarm_is_read` char(1) NOT NULL DEFAULT 'N' COMMENT '알림 확인 여부',
  `alarm_is_deleted` char(1) NOT NULL DEFAULT 'N' COMMENT '알림 삭제 여부',
  `alarm_url` varchar(255) NOT NULL COMMENT '관련 알림 주소',
  PRIMARY KEY (`alarm_no`),
  KEY `emp_id` (`emp_id`),
  CONSTRAINT `alarms_ibfk_1` FOREIGN KEY (`emp_id`) REFERENCES `employee` (`emp_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='알림';

