-- 테이블 withxwork.employee 구조 내보내기
CREATE TABLE IF NOT EXISTS `employee` (
  `emp_id` int(11) unsigned NOT NULL COMMENT '사번',
  `emp_pw` varchar(250) NOT NULL DEFAULT 'work1234' COMMENT '비밀번호',
  `emp_name` varchar(10) NOT NULL COMMENT '이름',
  `emp_ssn` varchar(14) NOT NULL DEFAULT '000000-0000000' COMMENT '주민등록번호',
  `emp_phone` varchar(13) NOT NULL DEFAULT '000-0000-0000' COMMENT '개인 번호',
  `emp_address` varchar(225) DEFAULT NULL COMMENT '주소',
  `emp_address_detail` varchar(225) DEFAULT NULL COMMENT '상세 주소',
  `emp_profile_picture` longtext DEFAULT NULL COMMENT '프로필 이미지 경로',
  `emp_sign_image` longtext DEFAULT NULL COMMENT '서명 이미지 경로',
  `dept_no` int(11) unsigned NOT NULL COMMENT '부서 번호',
  `job_no` int(11) unsigned NOT NULL COMMENT '직급 번호',
  `emp_hire` date DEFAULT NULL COMMENT '입사일',
  `emp_end` date DEFAULT NULL COMMENT '퇴사일',
  `emp_status` char(1) NOT NULL DEFAULT 'Y' COMMENT '재직 상태',
  `emp_auth` varchar(10) NOT NULL DEFAULT 'USER' COMMENT '권한',
  PRIMARY KEY (`emp_id`),
  KEY `dept_no` (`dept_no`),
  KEY `job_no` (`job_no`),
  CONSTRAINT `employee_ibfk_1` FOREIGN KEY (`dept_no`) REFERENCES `departments` (`dept_no`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `employee_ibfk_2` FOREIGN KEY (`job_no`) REFERENCES `jobs` (`job_no`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='직원';

