CREATE TABLE IF NOT EXISTS `work_history` (
  `work_history_no` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '근무내역코드',
  `work_history_date` date NOT NULL COMMENT '근무날짜',
  `work_history_total_time` decimal(5,2) unsigned NOT NULL COMMENT '총근무시간',
  `work_history_over_time` decimal(5,2) unsigned NOT NULL COMMENT '초과근무시간',
  `emp_id` int(11) unsigned NOT NULL COMMENT '사번',
  PRIMARY KEY (`work_history_no`),
  KEY `emp_id` (`emp_id`),
  CONSTRAINT `work_history_ibfk_1` FOREIGN KEY (`emp_id`) REFERENCES `employee` (`emp_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='근무 내역 테이블';

